:false},\"text\":\"<h2>Look at the above picture. Count and write the number of objects given below.</h2>\\n\\n<h2>ଉପରୋକ୍ତ ଚିତ୍ରକୁ ଦେଖନ୍ତୁ । ନିମ୍ନରେ ଦିଆଯାଇଥିବା ବସ୍ତୁର ସଂଖ୍ୟା ଗଣନା କରି ଲେଖନ୍ତୁ ।</h2>\\n\\n<h2>चित्र को देखिए एवं दिखाई गई वस्तुओं को गिनकर लिखिए।</h2>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100}],\"showSolutions\":\"Show solution\",\"tryAgain\":\"Retry\",\"checkAnswer\":\"Check\",\"submitAnswer\":\"Submit\",\"notFilledOut\":\"Please fill in all blanks to view solution\",\"answerIsCorrect\":\"':ans' is correct\",\"answerIsWrong\":\"':ans' is wrong\",\"answeredCorrectly\":\"Answered correctly\",\"answeredIncorrectly\":\"Answered incorrectly\",\"solutionLabel\":\"Correct answer:\",\"inputLabel\":\"Blank input @num of @total\",\"inputHasTipLabel\":\"Tip available\",\"tipLabel\":\"Tip\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"autoCheck\":true,\"caseSensitive\":true,\"showSolutionsRequiresInput\":true,\"separateLines\":false,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"acceptSpellingErrors\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"a11yCheckingModeHeader\":\"Checking mode\",\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"questions\":[\"<p>(Coconuts/ନଡ଼ିଆ/नारियलों की संख्या) *27*&nbsp; &nbsp; (Boats/ଡଙ୍ଗା/नावों की संख्या) *12*</p>\\n\\n<p>(Children/ପିଲାମାନେ/बच्चों की संख्या) *6*&nbsp; (Oranges/କମଳା/संतरों की संख्या) *20*</p>\\n\\n<p>&nbsp;</p>\\n\",\"<p>A. Look at the shops shown in the picture and fill in the blanks.</p>\\n\\n<p>i. There are *10* necklaces of shells with 10 shells in each necklace.</p>\\n\\n<p>ii. There are *6* groups of balloons with *4* balloons in each group and *2* loose balloons.</p>\\n\\n<p>iii. There are *6* bunches of bananas with *12* bananas in each bunch and *3* loose bananas.</p>\\n\\n<p>क. चित्र में दिखाई गई दुकानों को देखिए और रिक्त स्थान भरिए।<br>\\ni.. सीपियों की&nbsp; *10*&nbsp; &nbsp; मालाएँ हैं। प्रत्येक माला में 10 सीपियाँ हैं।<br>\\nii.. गुब्बारों के&nbsp; *6*&nbsp; &nbsp; समूह हैं। प्रत्येक समूह में&nbsp; &nbsp; &nbsp; *4*&nbsp; &nbsp;गुब्बारे हैं एवं गुब्बारे&nbsp; &nbsp;*2* &nbsp;शेष हैं।<br>\\niii. केलों के&nbsp; &nbsp;*6* &nbsp; &nbsp;गुच्छे हैं। प्रत्येक गुच्छे में&nbsp; &nbsp;*12* &nbsp; &nbsp;केले हैं एवं&nbsp; &nbsp; *3*&nbsp; केले शेष हैं।</p>\\n\\n<p>କ. ଚିତ୍ରରେ ଦେଖାଯାଇଥିବା ଦୋକାନଗୁଡ଼ିକୁ ଦେଖନ୍ତୁ ଏବଂ ଖାଲି ସ୍ଥାନଗୁଡିକ ପୁରଣ କରନ୍ତୁ ।<br>\\ni. ପ୍ରତି ହାରରେ 10ଟି ଶଙ୍ଖ ଥିବା&nbsp; &nbsp;*10* &nbsp; &nbsp; ଟି ଶଙ୍ଖ ର ହାର ରହିଛି।<br>\\nii. ପ୍ରତ୍ୟେକ ଗୋଷ୍ଠୀରେ&nbsp; *4*&nbsp; ବେଲୁନ୍ ସହିତ ବେଲୁନ୍ଗୁଡ଼ିକର&nbsp; &nbsp;*6*&nbsp;&nbsp;&nbsp;ଗୋଷ୍ଠୀ ଅଛି ଏବଂ&nbsp; &nbsp;*2* &nbsp;ଲୁଜ୍(ଖୋଲା) ବେଲୁନ୍&nbsp;ଅଛି |<br>\\niii. କଦଳୀର&nbsp; &nbsp; *6* &nbsp; &nbsp;ଫେଣା ଅଛି। ପ୍ରତ୍ୟେକ ଫେଣାରେ&nbsp; &nbsp;*12* &nbsp;କଦଳୀ ଅଛି ଏବଂ ବାକି ହେଉଛି&nbsp; &nbsp;*3* &nbsp;ଟି ଖୋଲା କଦଳୀ |<br>\\n&nbsp;</p>\\n\"]}","library":"H5P.Blanks 1.14","contentUrl":".","metadata":{"license":"U","title":"A day at the beach","defaultLanguage":"en"},"scripts":["/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-sp
